[[questions]]
id = "DC040"
question = "Vilka myndigheter har tillsyn över försäkringsbolagens verksamhet?"
answer = "I dag finns det inte någon myndighet eller instans som har till uppgift att granska villkoren, något som tidigare föll inom Finansinspektionens verksamhetsområde. 43 Försäkringsbolagens verksamhet faller dock i vissa hänseenden under Finansinspektionens, Konsumentverkets och Konkurrensverkets tillsynsområde"
