[[questions]]
id = "DC056"
question = "Vad kan sägas om köpfrekvensen för konsumenter som inte har bredband?"
answer = "Vidare så menar Post & telestyrelsen (2001) att för kunder som inte har en fast uppkoppling utan använder sig av uppkoppling per tidsenhet kan benägenheten att fönstershoppa för nöjets skull antas vara mindre. Vilket i sin tur leder till att en kund med uppkoppling per tidsenhet förmodas göra färre inköp än om kunden haft en fast uppkoppling enligt Post & Telestyrelsen"
