id = "DC086"
question = "Vad är skillnaden mellan bitcoin och NFT?"
answer = "NFT (non-fungible tokens), kan beroende på användningen behandlas som personliga tillgångar. För sådana tillgångar får omkostnadsbeloppet vid kapitalvinstberäkningen beräknas till 25 procent av erhållen ersättning. Bitcoin och liknande kryptotillgångar anses dock inte utgöra sådana personliga tillgångar och omfattas därför inte av den aktuella schablonregeln (se HFD 2018 ref. 72)"
